import React from "react";

const Userentry = () => {
  const heading = [
    {
      entryHeading: "Cycle 2",
    },
    {
      entryHeading: "16 Sep - 30 Sep",
    },
  ];

  const entries = [
    {
      userName: "Abhijeet Acharya",
    },
    {
      price: "1200",
    },
    {
      additionalInfo: "MH/2222483703",
    },
    {
      dateIssue: "Issued on 12 Dec - 2020",
    },
  ];
  monthdata ===
    [
      {
        name: "Cycle 2",
        additionalInfo: [
          {
            name: "Abhijeet Acharaya",
            price: 1200,
            addressLine1: "dsdsdsdd",
            addressLine2: "dsdsdsdd",
          },
          {
            name: "Abhijeet Acharaya",
            price: 1200,
            addressLine1: "dsdsdsdd",
            addressLine2: "dsdsdsdd",
          },
        ],
      },
      {
        name: "Cycle 1",
        additionalInfo: [
          {
            name: "Double Dhamaka",
            price: 1200,
            typeofpurchase: "life boaster",
          },
        ],
      },
    ];
  return (
    <section>
      <h1>{heading[0].entryHeading}</h1>
      <p>{heading[1].entryHeading}</p>
    </section>
  );
};

export default Userentry;
